import Link from 'next/link';
const Navbar = () => (
    <div className="menu">
        <div className="label">Menu</div>
        <div class="cpacer"></div>
                <div class="item"><span><Link href='/'><a>Home</a></Link></span></div>
                <div class="item"><span><Link href='/about'><a>About</a></Link></span></div>
                <div class="item"><span><Link href='/articles'><a>Articles</a></Link></span></div>
                <div class="item"><span><Link href='/projects'><a>Projects</a></Link></span></div>
        <style jsx>
            {`.menu{
                text-transform:uppercase;
                letter-spacing: 2px;
                color: #424242;
                display: inline-block;
                cursor: pointer;
                pointer-events: none;
                bottom: 10px;
                left: 20px;
            }
              .menu:hover{
                  pointer-events:all;
              }
              .label{
                  display:inline-block;
                  cursor: pointer;
                  pointer-events: all;
                  font-size: small;
                  letter-spacing: 2px;
              }
            `}
        </style>

    </div>
);

export default Navbar;
